	function images() {
		var selection = "<div class='upload__overlay'><div class='upload__icon'><i class='material-icons'>done</i></div></div>",
		    trash = "<div class='upload__trash'><i class='material-icons trash'>clear</i></div>",
				images = [],
				outputImages = {
					main: [],
					gallery: []
				},
				wrappers = $('.option__item');
		
		wrappers.each(function(e) { 
			var input =$(this).find('#gallery-images').attr('id', 'gallery-item-' + e),
			 		mainImageHolder = $(this).find('#upload__img').attr('id', 'upload__img-' + e).attr("name", "Post-"+e+"-Form[photo_js]"),
					galleryImagesHolder = $(this).find('#upload__images').attr('id', 'upload__images-' + e).attr("name", "Post-"+e+"-Form[gallery_js]"),
					preview = $(this).find('#gallery-images-preview').attr('id', 'gallery-images-preview-' + e),
					galleryPreview = $("#gallery-images-preview-"+e+" .upload__home"),
					galleryPreviewChild = $("#gallery-images-preview-"+e+" .upload__target:nth-child(2) .upload__bg"),
					galleryPreviewChildTwo = $("#gallery-images-preview-"+e+" .upload__target:first-child .upload__bg");
		

			function renderImages() {
				// Clean the Field and Stack
				preview.html("");
				images = [];
		
				var inputFiles = input[0].files;
				var length = inputFiles.length;
				for (var i = 0; i < length; i++) {
					var animateInWrapper = function animateInWrapper(index) {
						wrapper.delay(index * 200).fadeIn(300);
					};	
					// Extension
					if (i == 30) {
						break;
					}	
					// Create Stack
					images.push({
						src: inputFiles[i].name,
						tmp: URL.createObjectURL(inputFiles[i])
					});		
					// DOMs
					var image = $("<div/>", {
						class: !i ? "upload__bg upload__home" : "upload__bg",
						style: "background: url(" + images[i].tmp + ") 50% / cover;",
						// html: !i ? selection + trash : trash
						html: trash
					});
					var wrapper = $("<div/>", {
						class: "upload__item upload__target",
						html: image
					});		
					// Render
					preview.append(wrapper);	
					animateInWrapper(i);
				}
		
				// Set Output Images
				outputImages.main = images[0].src;
				outputImages.gallery = images.map(function (el) {
					return el.src;
				});
			}


			$(this).find(input).on("change", function (e) {			
				renderImages(); // Render Images
				var items = $(".upload__bg");
				var currentItem = galleryPreview;
				mainImageHolder.val(outputImages.main);
				galleryImagesHolder.val(outputImages.gallery);
				items.on("click", function (e) {
					var target = $(e.target); // find click target
					var imagesIndex;

					
					// change main image
					if (target.hasClass("upload__bg")) {
						
						imagesIndex = images.findIndex(function (item) {
							console.log(item);
							return item.tmp == target.css("background-image").replace(/(url\(|\)|")/g, "");
						});
						
						var overlay = currentItem.find(".upload__overlay");
						overlay.remove();
						currentItem.removeClass("upload__home");
						currentItem = target;
						target.addClass("upload__home").append(selection);
						outputImages.main = images[imagesIndex].src;
						mainImageHolder.val(outputImages.main);
					} else if (target.hasClass("trash")) {
						// remove image
						imagesIndex = target.parents(".upload__target").index();
						if (target.parent(".upload__bg").hasClass("upload__home")) {
							if (imagesIndex == 0) {
								currentItem = galleryPreviewChild;
								currentItem.addClass("upload__home").append(selection);
								outputImages.main = images[1].src;
							} else {
								currentItem = galleryPreviewChildTwo;
								currentItem.addClass("upload__home").append(selection);
								outputImages.main = images[0].src;
							}
							mainImageHolder.val(outputImages.main);
						}
						images = images.filter(function (item, i) {
							return i !== imagesIndex;
						});
						outputImages.gallery = images.map(function (el) {
							return el.src;
						});
						galleryImagesHolder.val(outputImages.gallery);
						var col = target.parents(".upload__item");
						col.remove();
					}
					// console.log(outputImages);
				});
			});
		});
	}
	images();


